// SPDX-License-Identifier: MIT
pragma solidity >=0.7.5;
pragma abicoder v2;

import "@uniswap/v3-periphery/contracts/interfaces/IQuoterV2.sol";


contract PriceProtocol {
    address WETH = 0xC02aaA39b223FE8D0A0e5C4F27eAD9083C756Cc2;
    IQuoterV2 quoter = IQuoterV2(0xb27308f9F90D607463bb33eA1BeBb41C27CE5AB6);

    function getPrice(address tokenOut, uint amount, uint24 poolFee) public returns (uint) {
        IQuoterV2.QuoteExactInputSingleParams memory params = IQuoterV2.QuoteExactInputSingleParams({
            tokenIn: WETH,
            tokenOut: tokenOut,
            amountIn: amount,
            fee: poolFee,
            sqrtPriceLimitX96: 0
        });
        
        (uint256 amountOut, , ,) = quoter.quoteExactInputSingle(params);
        return amountOut;
    }
}
